sys_variable_value.value:
(function execute(inputs, outputs) {
      var responseObject = JSON.parse(inputs.response_body);
      outputs.set_num = responseObject.set_num;
      outputs.name = responseObject.name;
      outputs.num_parts = responseObject.num_parts;
  })(inputs, outputs);

